def resetFsm(clk_fast, reset_fsm_r, reset_ctn):
    @always(clk_fast.posedge)
    def rtl():
        reset_fsm_r.next = YES
        if (reset_ctn < reset_dly_c):
            reset_fsm_r.next = NO
            reset_ctn.next = reset_ctn + 1
    return rtl
 


def JPEGFSM(state_r, state_x, addr_rom_r, addr_rom_x, sig_in_r, sig_in_x, dout_rom):
    @always_comb
    def FSM():
        addr_rom_x.next = addr_rom_r
        sig_in_x.next = sig_in_r
        state_x.next = state_r
        if state_r == t_State.INIT:
            addr_rom_x.next = 0
            sig_in_x.next = 0
            state_x.next = t_State.READ_ROM
        elif state_r == t_State.READ_ROM:
            if noupdate_s == YES:
                if (addr_rom_r <= 130046):
                    sig_in_x.next = dout_rom
                    addr_rom_x.next = addr_rom_r + 1
                else:
                    state_x.next = t_State.DONE
            else:
                sig_in_x.next = 0
        elif state_r == t_State.DONE:
            state_x.next = t_State.INIT
    return FSM
def jpegfsmupdate(clk_fast,
                  state_r, state_x, addr_rom_r, addr_rom_x,
                  sig_in_r, sig_in_x
                  ):
    @always(clk_fast.posedge)
    def fsmupdate():
        state_r.next = state_x
        addr_rom_r.next = addr_rom_x
        sig_in_r.next = sig_in_x
 
    return fsmupdate
 
 
def jpeg_process(clk_fast, sig_in_x,  noupdate_s, res_s):
    left_s = sig_in_x(9,0)
    sam_s = sig_in_x(18,9)
    right_s = sig_in_x(26,18)
    even_odd_s = sig_in_x(27)
    fwd_inv_s = sig_in_x(28)
    updated_s = sig_in_x(29)
    dum_s = sig_in_x(30)
    @always(clk_fast.posedge)
    def jpeg():
        if updated_s:
            noupdate_s.next = 0
            if even_odd_s:
                if  fwd_inv_s:
                    res_s.next =  sam_s - ((left_s >> 1) + (right_s >> 1))
                else:
                    res_s.next =  sam_s + ((left_s >> 1) + (right_s >> 1))
            else:
                if fwd_inv_s:
                    res_s.next =  sam_s + ((left_s +  right_s + 2)>>2)
                else:
                    res_s.next =  sam_s - ((left_s +  right_s + 2)>>2)
        else:
            noupdate_s.next = 1
    return jpeg
 
